import React, { useState, useEffect } from 'react';
import { subDays } from 'date-fns';
import { fetchDashboardMetrics, fetchMetricDetails } from './services/api';
import MetricCard from './components/MetricCard';
import DateRangePicker from './components/DateRangePicker';
import MetricDetailsModal from './components/MetricDetailsModal';
import { BarChart3, TrendingUp, Users, CreditCard, Activity, Target } from 'lucide-react';

function App() {
  const [startDate, setStartDate] = useState(subDays(new Date(), 30));
  const [endDate, setEndDate] = useState(new Date());
  const [metrics, setMetrics] = useState({});
  const [isLoading, setIsLoading] = useState(true);
  const [selectedMetric, setSelectedMetric] = useState(null);
  const [metricDetails, setMetricDetails] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [isDetailsLoading, setIsDetailsLoading] = useState(false);

  const metricConfigs = {
    'dormant_account_rate': {
      title: 'Dormant Account Rate',
      icon: Users,
      description: 'Percentage of new purchasers with zero sessions after first purchase'
    },
    'involuntary_churn_rate': {
      title: 'Involuntary Churn Rate',
      icon: CreditCard,
      description: 'Percentage of subscriptions canceled due to failed payments'
    },
    'dunning_recovery_rate': {
      title: 'Dunning Recovery Rate',
      icon: Activity,
      description: 'Percentage of failed invoices that were later paid'
    },
    't24h_activation_rate': {
      title: '24h Activation Rate',
      icon: Target,
      description: 'Percentage of new users who performed a key action within 24 hours'
    },
    'source_attribution_coverage': {
      title: 'Source Attribution Coverage',
      icon: BarChart3,
      description: 'Percentage of pageviews with campaign attribution data'
    }
  };

  useEffect(() => {
    fetchMetrics();
  }, [startDate, endDate]);

  const fetchMetrics = async () => {
    setIsLoading(true);
    try {
      const data = await fetchDashboardMetrics(
        startDate.toISOString(),
        endDate.toISOString()
      );
      setMetrics(data);
    } catch (error) {
      console.error('Failed to fetch metrics:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleViewDetails = async (metric) => {
    setSelectedMetric(metric);
    setIsModalOpen(true);
    setIsDetailsLoading(true);

    try {
      const details = await fetchMetricDetails(
        metric,
        startDate.toISOString(),
        endDate.toISOString()
      );
      setMetricDetails(details);
    } catch (error) {
      console.error('Failed to fetch metric details:', error);
      setMetricDetails([]);
    } finally {
      setIsDetailsLoading(false);
    }
  };

  const handleDateChange = (newStartDate, newEndDate) => {
    setStartDate(newStartDate);
    setEndDate(newEndDate);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setSelectedMetric(null);
    setMetricDetails([]);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="bg-white shadow-sm border-b">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            <div className="flex items-center">
              <BarChart3 className="w-8 h-8 text-primary-600 mr-3" />
              <h1 className="text-2xl font-bold text-gray-900">SaaS Metrics Dashboard</h1>
            </div>
            <div className="text-sm text-gray-500">
              {startDate.toLocaleDateString()} - {endDate.toLocaleDateString()}
            </div>
          </div>
        </div>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="grid grid-cols-1 lg:grid-cols-4 gap-6 mb-8">
          <div className="lg:col-span-1">
            <DateRangePicker
              startDate={startDate}
              endDate={endDate}
              onDateChange={handleDateChange}
            />
          </div>

          <div className="lg:col-span-3">
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {Object.entries(metricConfigs).map(([key, config]) => {
                const metric = metrics[key];
                const Icon = config.icon;

                return (
                  <MetricCard
                    key={key}
                    title={config.title}
                    value={metric?.value}
                    previousValue={metric?.previous_value}
                    definition={metric?.definition}
                    status={metric?.status || 'missing'}
                    message={metric?.message}
                    numerator={metric?.numerator}
                    denominator={metric?.denominator}
                    onViewDetails={() => handleViewDetails(key)}
                    isLoading={isLoading}
                  />
                );
              })}
            </div>
          </div>
        </div>

        {/* Additional sections can be added here */}
        {metrics.root_cause_pareto && (
          <div className="bg-white rounded-lg border p-6 shadow-sm mb-6">
            <h2 className="text-lg font-semibold text-gray-900 mb-4">Root Cause Analysis</h2>
            <div className="space-y-3">
              {metrics.root_cause_pareto.map((item, index) => (
                <div key={index} className="flex items-center justify-between p-3 bg-gray-50 rounded-md">
                  <span className="font-medium text-gray-700">{item.reason}</span>
                  <span className="text-sm text-gray-500">{item.count.toLocaleString()}</span>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>

      <MetricDetailsModal
        isOpen={isModalOpen}
        onClose={closeModal}
        metric={selectedMetric}
        data={metricDetails}
        isLoading={isDetailsLoading}
      />
    </div>
  );
}

export default App;
